import React from "react";
import { useDispatch } from "react-redux";
import { useEffect } from "react";
import { useSelector } from "react-redux";
import { Container, Card, Col, Row } from "react-bootstrap";
import { getEmployees } from "../actions/employees";

const Employees = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getEmployees())
      .then(() => {
        console.log("Employees fetched successfully");
      })
      .catch(() => {
        console.log("Unable to fetch employees");
      });
  }, [dispatch]);
  const { employees } = useSelector((state) => state.employees);
  console.log(employees);
  const Role = {
    0: "Software Developer Engineer",
    1: "Project Manager",
    2: "Administrator",
  };

  return (
    <Container>
      <br />
        <div className="d-flex justify-content-around">
      <Row xs={1} md={2} className="g-4">
        {employees.map((e) => {
          return (
            <Col>
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src=""><i class="bi bi-file-person"></i></Card.Img>
                <Card.Body>
                  <Card.Title>{e.firstname + " " + e.lastname}</Card.Title>
                  <Card.Text>Email: {e.email}</Card.Text>
                  <Card.Text>Role: {Role[e.role]};</Card.Text>
                </Card.Body>
              </Card>
            </Col>
          );
        })}
      </Row>
      </div>
    </Container>
  );
};

export default Employees;
